            let isSkip = false;
            // tslint:disable-next-line
            let viewerBase = this.pdfViewer.viewerBase;
            if (viewerBase && viewerBase.isPasswordAvailable && viewerBase.passwordData === '') {
                isSkip = true;
                this.retryCount = 0;
            }
            if (this.retryCount > 0) {
                isSkip = this.resendRequest(this, jsonObj);
            }
